import axios from "axios";

const API_URL = "http://localhost:8082/api/residents/create";

/**
 * Hàm gửi yêu cầu tạo resident.
 * @param {Object} residentData - Dữ liệu của resident cần tạo (name, age, address).
 * @returns {Promise<Object>} - Kết quả từ server.
 */
const createResident = async (residentData) => {
  try {
    const response = await axios.post(API_URL, residentData, {
      headers: {
        "Content-Type": "application/json",
      },
    });
    return response.data; // Trả về dữ liệu từ server
  } catch (error) {
    console.error("Error creating resident:", error);
    throw error.response?.data || { message: "An error occurred." };
  }
};

export { createResident };
